import React from "react";
import "./Resume.css"; // Make sure to import your CSS file
import { FaHtml5, FaJs, FaReact, FaNode, FaCss3 } from "react-icons/fa";

const skillsList = [
  {
    name: "Web Development",
    iconComponent: <FaHtml5 />,
  },
  {
    name: "JavaScript",
    iconComponent: <FaJs />,
  },
  {
    name: "React",
    iconComponent: <FaReact />,
  },
  {
    name: "Node.js",
    iconComponent: <FaNode />,
  },
  {
    name: "HTML/CSS",
    iconComponent: <FaCss3 />,
  },
  // Add more skills here
];

const Resume = () => {
  return (
    <div className="resume-container">
      <div className="resume">
        <div className="resume-left">
          <div className="skills">
            <h2>Skills</h2>
            <div>
              {skillsList.map((skill, index) => (
                <p key={index}>
                  {skill.iconComponent} {skill.name}
                </p>
              ))}
            </div>
          </div>
        </div>
        <div className="resume-right">
          <div className="resume-heading">
            <h1>Your Name</h1>
            <p>Full Stack Software Engineer</p>
          </div>
          <div className="resume-section">
            <h2>Summary</h2>
            <p>
              I am a Full Stack Software Engineer with a passion for creating
              innovative solutions and bringing ideas to life. I'm ready to take
              on new challenges and contribute to exciting projects.
            </p>
          </div>
          {/* Add more sections of your resume here */}
          <div className="resume-divider"></div>
          <div className="resume-download">
            <a href="/path-to-resume.pdf" download>
              Download PDF
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Resume;
